CREATE DEFINER=`root`@`localhost` PROCEDURE `AddProduct` (IN `p_商品編號` INT, IN `p_商品名稱` VARCHAR(20), IN `p_商品圖片` MEDIUMBLOB, IN `p_商品數量` INT, IN `p_商品單價` INT)   BEGIN
