    VALUES (p_商品編號, p_商品名稱,p_商品圖片, p_商品數量, p_商品單價);
END$$

CREATE DEFINER=`abuser1`@`%` PROCEDURE `AddToCart` (IN `p_帳號` VARCHAR(20), IN `p_商品編號` INT, IN `p_購買數量` INT)   BEGIN
    DECLARE productPrice INT DEFAULT 0;
    DECLARE currentQuantity INT DEFAULT 0;


SELECT 商品單價 INTO productPrice
    FROM 商品表
    WHERE 商品編號 = p_商品編號;


IF EXISTS (SELECT 1 FROM 購物車 WHERE 帳號 = p_帳號 AND 商品編號 = p_商品編號) THEN

SELECT 購買數量 INTO currentQuantity
        FROM 購物車
        WHERE 帳號 = p_帳號 AND 商品編號 = p_商品編號;

        UPDATE 購物車
        SET 購買數量 = currentQuantity + p_購買數量,
            購物車總價格 = (currentQuantity + p_購買數量) * productPrice
        WHERE 帳號 = p_帳號 AND 商品編號 = p_商品編號;
    ELSE

INSERT INTO 購物車 (帳號, 商品編號, 購物車總價格, 商品單價, 購買數量)
        VALUES (p_帳號, p_商品編號, productPrice * p_購買數量, productPrice, p_購買數量);
    END IF;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `更新暢銷排行` ()   BEGIN
    DECLARE 排名 INT DEFAULT 0;
    -- step 1 
    delete from 暢銷排行;

    -- Step 2: 根據銷量排序，逐行插入並生成排名
    INSERT INTO 暢銷排行 (暢銷編號, 商品編號, 總銷量)
    SELECT 
        (@排名 := @排名 + 1) AS 暢銷編號, -- 使用變數生成排名
        商品編號,
        總銷量
    FROM (
        SELECT 
            商品編號, 
            SUM(購買數量) AS 總銷量
        FROM 訂單商品關聯表
        GROUP BY 商品編號
        ORDER BY 總銷量 DESC
    ) 排序結果, (SELECT @排名 := 0) 初始化; -- 初始化排名變數

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `更新狀態` (IN `my訂單編號` INT, IN `new_STATUS` VARCHAR(20))   BEGIN
    -- 檢查訂單是否存在
    IF EXISTS (SELECT 1 FROM 訂單 WHERE 訂單編號 = 訂單編號) THEN
        -- 更新訂單狀態
        UPDATE 訂單
        SET 訂單狀態 = new_status
        WHERE 訂單編號 = my訂單編號;
    ELSE
        -- 如果訂單不存在，報錯
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = '訂單 not found';
    END IF;
END$$

CREATE DEFINER=`abuser1`@`%` PROCEDURE `查看購物車價格` (IN `p_帳號` VARCHAR(20))   BEGIN

SELECT 商品編號, 商品表.商品名稱, 購買數量, 商品表.商品單價,
           (購物車.購買數量 * 商品表.商品單價) AS 總價格
    FROM 購物車
    JOIN 商品表 ON 購物車.商品編號 = 商品表.商品編號
    WHERE 購物車.帳號 = p_帳號;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `查詢訂單內容` (IN `p_帳號` VARCHAR(20), IN `p_訂單編號` INT)   BEGIN
    -- 查询指定账号或订单编号的订单详细内容，包括订单状态
    SELECT 
        訂單.訂單編號,
        訂單.帳號,
        訂單.訂單總價格,
        訂單.訂單狀態, -- 加入訂單狀態字段
        訂單商品關聯表.商品編號,
        商品表.商品名稱,
        商品表.商品單價,
        訂單商品關聯表.購買數量,
        訂單商品關聯表.商品總價格
    FROM 
        訂單
    INNER JOIN 訂單商品關聯表 ON 訂單.訂單編號 = 訂單商品關聯表.訂單編號
    INNER JOIN 商品表 ON 訂單商品關聯表.商品編號 = 商品表.商品編號
    WHERE 
        訂單.帳號 = p_帳號
        AND (p_訂單編號 IS NULL OR 訂單.訂單編號 = p_訂單編號);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `檢查並減少庫存` (IN `my商品名稱` VARCHAR(20), IN `my商品數量` INT, OUT `is_successful` BOOLEAN)   BEGIN
    DECLARE current_stock INT;

    -- 查詢目前庫存
    SELECT 商品數量 INTO current_stock FROM 商品表 WHERE 商品名稱 = my商品名稱;

    -- 判斷庫存是否足夠
    IF current_stock >= my商品數量 THEN
        -- 減少庫存
        UPDATE 商品表
        SET 商品數量 = 商品數量 - my商品數量
        WHERE 商品名稱 = my商品名稱;

        SET is_successful = TRUE;
    ELSE
        SET is_successful = FALSE;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `處理結帳` (IN `p_帳號` VARCHAR(20))   BEGIN
    DECLARE v_訂單編號 INT;
    DECLARE v_訂單總價格 INT;
    DECLARE v_當前日期 CHAR(8);
    DECLARE v_流水號 INT;

    -- Step 1: 取得當前日期 (格式 YYYYMMDD)
    SET v_當前日期 = DATE_FORMAT(NOW(), '%Y%m%d');

    -- Step 2: 計算當天的訂單流水號
    SELECT COALESCE(MAX(訂單編號) MOD 100 + 1, 1)
    INTO v_流水號
    FROM 訂單
    WHERE 訂單編號 DIV 100 = v_當前日期;

    -- Step 3: 生成訂單編號
    SET v_訂單編號 = v_當前日期 * 100 + v_流水號;

    -- Step 4: 計算訂單總價格
    SELECT SUM(購物車總價格)
    INTO v_訂單總價格
    FROM 購物車
    WHERE 帳號 = p_帳號;

    -- Step 5: 建立新訂單
    INSERT INTO 訂單 (訂單編號, 帳號, 訂單總價格)
    VALUES (v_訂單編號, p_帳號, v_訂單總價格);

    -- Step 6: 將購物車資料插入到訂單商品關聯表
    INSERT INTO 訂單商品關聯表 (商品編號, 訂單編號, 購買數量, 商品總價格)
    SELECT 商品編號, v_訂單編號, 購買數量, 購物車總價格
    FROM 購物車
    WHERE 帳號 = p_帳號;

    -- Step 7: 更新商品庫存
    UPDATE 商品表
    SET 商品數量 = 商品數量 - (
        SELECT 購買數量
        FROM 購物車
        WHERE 購物車.商品編號 = 商品表.商品編號 AND 帳號 = p_帳號
    )
    WHERE 商品表.商品編號 IN (
        SELECT 商品編號
        FROM 購物車
        WHERE 帳號 = p_帳號
    );

    -- Step 8: 清空購物車
    DELETE FROM 購物車
    WHERE 帳號 = p_帳號;
END$$

