CREATE TRIGGER `UpdateCartPrice` AFTER UPDATE ON `商品表` FOR EACH ROW BEGIN
    -- 更新購物車中的價格
    UPDATE 購物車
    SET 商品單價 = NEW.商品單價,
     購物車總價格 = NEW.商品單價*購買數量
   WHERE 商品編號 = NEW.商品編號;
END
$$
